import React, { useState, useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import isEmpty from 'lodash.isempty'

import { Developer } from '../components'
import { sessionDeleteRequest } from '../store/sessions/actions'
import { getJobsRequest } from '../store/jobs/actions'
// import { history } from '../../services'

// const initialState = {
//   email: '',
//   password: ''
// }

export const DeveloperContainer = () => {
  const dispatch = useDispatch()

  const [selectedProject, setSelectedProject] = useState(null)
  const [selectedCategory, setSelectedCategory] = useState(null)
  const [value, setValue] = useState('')

  const { data } = useSelector(state => state.sessions)

  useEffect(() => {
    // dispatch(getJobsRequest('jobs'))
  }, [])

  // const handleChange = (key, text) => {
  //   setValue({...value, [key]: text})
  //   // errorsState[key] && setErrorsState({...errorsState, [key]: ''})
  // }

  // useEffect(() => {
  //   if (!isEmpty(data)) {
  //     console.log('wedfwedwedf')
  //   }
  // }, [data])

  const logOut = () => {
    dispatch(sessionDeleteRequest('authentications'))
  }

  const handleChange = (e) => {
    const financialGoal = (e.target.validity.valid) ? e.target.value : value
    setValue(financialGoal)
  }

  const create = () => {
    const data = { project: selectedProject.value, category: selectedCategory.value, hours: value }
  }

  return (
    <Developer
      logOut={ logOut }
      user={ data.user }
      selectedProject={ selectedProject }
      setSelectedProject={ setSelectedProject }
      selectedCategory={ selectedCategory }
      setSelectedCategory={ setSelectedCategory }
      setValue={ setValue }
      value={ value }
      handleChange={ handleChange }
      create={ create }
    />
  )
}
